def test():
  import pseudoprimes
  bases = [2] + [j for j in range(3, 340, 2) if pow(2, j, j) == 2]
  for i,factors in enumerate(L1 + L2):
    p, q, r = factors
    n = p*q*r
    for f in factors:
      assert (n - 1) % (f - 1) == 0
    assert pow(2, n, n) == 2
    L = [b for b in bases if pseudoprimes.is_strong_pseudoprime(n, b)]
    print(i, n % 4, len(L), len(L)/len(bases), L)

def pp():
  for factors in L2:
    p, q, r = factors
    n = p*q*r
    print(n.bit_length())
    cnt = 0
    if n % 4 == 3 or cnt < 3:
      if n % 4 == 1: cnt += 1
      print("  prod(%d,\n       %d,\n       %d)," % factors) 

if __name__ == "__main__":
  pp()
  # test()
